WorkItem.Description:
jquery's .ajaxTransport method, as documented at http://api.jquery.com/jQuery.ajaxTransport/, is not yet supported by jquery.d.ts.

I've been using the following type definitions to support it.

```
interface JQueryTransport {
    send(headers: { [index: string]: string; }, completeCallback: (status: number, statusText: string, responses?: { [dataType: string]: any; }, headers?: string) => any): any;
    abort(): any;
}

interface JQueryStatic {
    ajaxTransport(dataType: string,
        handler: (options: JQueryAjaxSettings, originalOptions: JQueryAjaxSettings, jqXHR: JQueryXHR) => JQueryTransport);
}

```
